import React from 'react'

class Pos_tagger extends React.Component {
  constructor(props) {
    super(props);
  }

  api_request = async function (component, method="GET", data=null) {
    var request = {
      method: method,
    }
    if (data !== null) {
      request.headers= {
        'Content-Type': 'application/json',
      },
      request["body"] = JSON.stringify(data)
    }
    const value = await fetch(`api/components/${component}`, request);
    return value.json();
  }

  POS_Tagger = async function (element) {
    console.log(document)
    if (element.value.length > 0)
      api_request('POS_Tagger', "POST", {
        sentence: element.value
      })
      .then(response => {
        console.log(response)
      })
  }

  render() {
    return (
      <div className="jumbotron">
        <h1>POS Tagger</h1>
        <p>Enter a sentence and press enter.</p>
        <div className="d-flex justify-content-sm-start align-items-sm-center" style={{textAlign: "center"}}>
          <input className="d-inline-flex flex-grow-1 align-content-start justify-content-sm-start align-items-sm-center" type="text" id="POS_tagger-input" style={{marginRight: "10px", maxWidth: "80%"}}></input>
          <a className="btn btn-primary" role="button" id="POS_tagger-button" onClick={() => POS_Tagger(document.getElementById('POS_tagger-input'))}>Submit</a>
        </div>
      </div>
    )
  }

}

export default Pos_tagger;
